import React from 'react';

const ParkCell = ({row,col,operations}) => {
  let visible = row === operations.row && col === operations.col;
  if(visible){
    return (<div className='box'> VISIBLE </div>);
  } else {
    return (<div className='box'> INVISIBLE </div>);
  }
}
export default ParkCell;
